function App() {
  return (
    <>
      <h1 className="heading">List of Top 5 Netflix series</h1>
      <Cards
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        sname={Sdata[0].sname}
        link={Sdata[0].link}
      />
      Sdata.map(ndata)
    </>
  );
}

export default App;
